jobs_results.description:
We are looking for an (Embedded) iOS SDK Developer in Antwerp, Belgium. As (Embedded) iOS SDK Developer, you will be working on the Mobile Software Development Kit (SDK) of our customer and dive deep into low-level embedded programming. English speaking candidates are welcome to apply and need to be willing to relocate to Antwerp.

Tasks & Responsibilities:
• Implementation of the iOS build of the Software Development Kit of our customer;
• Technical analysis, develop deep understanding of low level Mobile APIs (scheduler, sensor handling, power management, …);
• Write technical documentation as part of the SDK documentation packs;
• Participate in internal brainstorm sessions on SDK features;
• Unit testing and regression testing, including automated testing;
• Package and deliver demo apps from testing environments to live app store releases;
• Support the team on ad-hoc tasks when required.

Profile:
• Bachelor or University degree;
• Experienced iOS Developer through past assignments developing iOS applications.
• Experience and deep understanding of low-level iOS service and operating system calls.
• Working knowledge and experience of native development on iOS (Core Services, Core OS).
• Understanding of MVC design patterns and architectures.

Nice to have:
• Basic understanding of signal processing.
• Experience with other mobile development environments (Android, React Native, Xamarin, Cordova, ...).
• Experience with Android Native Development Kit (NDK).
• Fluent in English;

Offered:

Challenging position at market leader, working on top products;

Attractive salary package;

Relocation and visa support;

Interested:

Please send your CV to vacature@talent40.com.

This a Full Remote job, the offer is available from: Europe

This is a remote position.

We are urgently looking for a Full Remote Senior iOS Developers based in Spain. Candidates need to have a good level of English or willing to improve/learn.

This position is only open for employees, who would like to work remote. Candidates need to be willing to go to the office in Murcia for 5 days on a quarterly base.

Tasks and Responsibilities:

​
• Design and develop software solutions to client requirements;
• Participate in identifying problem areas and defining solutions;
• Able to articulate problems and solutions in non-technical language to stakeholders;
• Understand interactions and dependencies between software components;
• Support the product engineering lead(s) in project set up, execution and key ceremonies including backlog refinement, sprint planning, demos and retrospectives;
• Support learning and development activities for junior product engineering resources;

Profile:
• College / university degree, Bacc. Ing. Comp (or similar);
• +2 years of iOS mobile development experience (Swift, Objective-C, ...);
• +5 years of software development experience;
• Strong understanding of Apple’s design principles & interface guidelines;
• Candidates need to have a good level of English and/or willing to improve/learn;

Offered:
• Attractive salary package (employees);
• Career development training;
• English classes;

Interested: Please send your resume to
resume@jobs4java.eu

